import SearchBar from "../SearchBar/SearchBar";
import './NavbarElements.css'

const Navbar = () => {
   
 return (

    <header color="dark">
      <div  className="nav-area">
         <a href="/#" className="logo"> 
          Logo
         </a> 
         <SearchBar />
         
        
      </div>
    </header>

 );
};

export default Navbar;
